import Data from "../BirdList.json"

const styles = {
    birdy: {

        display: 'flex',
        flexDirection: 'row',


    }
}

function Birds(props) {


    return (

        <div style={styles.birdy}>
            {Data.map((post) => {
                return (
                    <>
                        <h4 key={post.name}>{post.name}</h4>
                    </>
                )
            })}
        </div>)
}

export default Birds;
